import React from 'react';
import './MainHeader.css';

/*
Notes:
- Stick Header: https://www.w3schools.com/howto/howto_js_sticky_header.asp

*/

class MainHeader extends React.Component {

  // boilerplate code
  constructor(props) {
    super(props);
  }

  // what to do with drawing
  render() {
    return (
      <div class="mainheader">
        <h1>Jen Goldberg</h1>
        <div class="pageselections">
          <div class="column">
            <span>UXR</span>
          </div>
          <div class="column">
            <span>Graphic Design</span>
          </div>
          <div class="column">
            <span>Me</span>
          </div>
        </div>
      </div>
    );
  }
}

export default MainHeader;
